.imdoneio-plugin-view .input-med {
  width: 300px;
  float: left;
  margin-right: 5px;
}
.imdoneio-plugin-view .issue-list {
  position: absolute;
  top: 50px;
  bottom: 0;
  overflow: auto;
  width: 49%;
}
.imdoneio-plugin-view .issue-list.related-issues {
  right: 10px;
}
.imdoneio-plugin-view .issue-list.search-result {
  left: 10px;
}
.imdoneio-plugin-view .issue-list ol {
  list-style: none;
  padding-left: 0;
}
.imdoneio-plugin-view .issue-list ol .well {
  background-color: #292c2f;
}
.imdoneio-plugin-view .issue-list ol .issue .issue-title {
  font-size: 1.25em;
}
.imdoneio-plugin-view .issue-list ol .issue .issue-title .issue-number {
  color: #fff;
}
.imdoneio-plugin-view .issue-list ol .issue .issue-state .badge {
  border-radius: 3px;
}
.imdoneio-plugin-view .issue-list .spinner {
  text-align: center;
}
